import { createApp } from 'vue'
import App from './App.vue'
import VueSpeech from '@codekraft-studio/vue-speech';
import i18n from "./i18n";
import { subjects } from "@/data";


const app = createApp(App);
app.use(VueSpeech);
app.use(i18n);
app.mount('#app');
